import {Container, Row, Col} from "reactstrap";
import logo from "../../assets/images/logo.png";

const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg='3' md='4' sm='6'>
                        <div className="logo">
                            <img src={logo} alt='logo'/>
                            <h5>Mama Leahs</h5>
                        </div>
                    </Col>
                    <Col lg='3' md='4' sm='6'> </Col>
                    <Col lg='3' md='4' sm='6'> </Col>
                    <Col lg='3' md='4' sm='6'> </Col>
                </Row>
            </Container>
        </footer>
    );
}
export default Footer;
